import Nav from 'react-bootstrap/Navbar';
import img from '../Images/navlogo.jpg';
function Navbar(){
    return(
        <>
           <Nav>
              <Nav.Brand aria-expanded={true}> 
              <img src={img} alt='navlogo'/>
              </Nav.Brand>
           </Nav>
        </>
    )
}

export default Navbar;
